import React, { Component } from 'react';
import "./posts.css";

export default class Posts extends Component {
    render() {
        return (
            <section id="posts" className="posts portfolio">
            <div className="container">
                <div className="blog-img post-title" style={{background: "url('assets/img/newspaper-new.jpeg') bottom / cover no-repeat"}}>
                <div data-aos="fade-down">
                <h1 className="text-center">SCM Stories</h1>
                <p>Testimonies from our senior friends!</p>
                </div>
            </div>


      </div>
    </section>
        )
    }
}
